$((function(){$(".testimonials__slider").slick({infinite:!0,slidesToShow:2,slidesToScroll:1,arrows:!1,dots:!0})}));const accordionItems=document.querySelectorAll(".faq__accordion-item");for(let t=0;t<accordionItems.length;t++){let e=accordionItems[t];e.addEventListener("click",(t=>{t.target.getAttribute("data-accord")===e.getAttribute("data-accord")&&e.classList.toggle("active")}))}